##method 2 achieve by myself
class RNA:

    # 静态属性定义 RNA 密码子表
    RNA_CODEX = {
        "A": ["GCU", "GCC", "GCA", "GCG"],
        "C": ["UGU", "UGC"],
        "D": ["GAU", "GAC"],
        "E": ["GAA", "GAG"],
        "F": ["UUU", "UUC"],
        "G": ["GGU", "GGC", "GGA", "GGG"],
        "H": ["CAU", "CAC"],
        "I": ["AUU", "AUC", "AUA"],
        "K": ["AAA", "AAG"],
        "L": ["UUA", "UUG", "CUU", "CUC", "CUA", "CUG"],
        "M": ["AUG"],
        "N": ["AAU", "AAC"],
        "P": ["CCU", "CCC", "CCA", "CCG"],
        "Q": ["CAA", "CAG"],
        "R": ["AGA", "AGG", "CGU", "CGC", "CGA", "CGG"],
        "S": ["AGU", "AGC", "UCU", "UCC", "UCA", "UCG"],
        "T": ["ACU", "ACC", "ACA", "ACG"],
        "V": ["GUU", "GUC", "GUA", "GUG"],
        "W": ["UGG"],
        "Y": ["UAU", "UAC"],
        "*": ["UGA", "UAA", "UAG"],  # 终止密码子
    }

    def __init__(self, sequence):
        """初始化对象

        Args:
            sequence (str): 一段RNA序列
        """
        self.sequence = sequence.upper()
        self.length = len(self.sequence)

    def trans_rna_to_protein(self):
        codon_to_aa = {
            codon: aa for aa, codons in self.RNA_CODEX.items() for codon in codons
        }
        protein = []
        for i in range(0, len(self.sequence), 3):
            codon = self.sequence[i : i + 3]
            if codon in codon_to_aa:
                aa = codon_to_aa[codon]
                if aa == "*":  # 遇到终止密码子停止翻译
                    break
                protein.append(aa)
            else:
                protein.append("?")  # 处理未知密码子
        return "".join(protein)

    def __str__(self):
        """
        定义打印时RNA对象现实的格式
        """
        return f"RNA Sequence: {self.sequence}\n" f"Length: {self.length}\n"


